interface CardProps {
    title: string,
    waitTime: string,
    img: string,
    rating: number

}

const Card: FunctionComponent<CardProps> = ({ title, waitTime, img, rating }) => {
    return (
        <div className=" w-full px-4 py-4 flex flex-wrap justify-between">
            <img src={img} alt="" className="h-32 w-full object-cover" />
            <div>
                <h1 className="font-bold py-1">{title}</h1>
                <p className="text-xs text-gray-700">{waitTime}</p>
            </div>
            <div className="">
                {rating}
            </div>
        </div>
    )
}
export default Card
